PROBLEM: 'Line '$l_1$' has equation '$3x - 2y = 1$' and goes through '$A = (-1, -2)$'. Line '$l_2$' has equation '$y = 1$' and meets line '$l_1$' at point '$B$'. Line '$l_3$' has positive slope, goes through point '$A$', and meets '$l_2$' at point '$C$'. The area of '$\triangle ABC$' is '$3$'. What is the slope of '$l_3$'?\n'
=======
CHOICES:
[A]: \frac{2}{3}
[B]: \frac{3}{4}
[C]: 1
[D]: \frac{4}{3}
[E]: \frac{3}{2}

PROBLEM: 'Two bees start at the same spot and fly at the same rate in the following directions. Bee '$A$' travels '$1$' foot north, then '$1$' foot east, then '$1$' foot upwards, and then continues to repeat this pattern. Bee '$B$' travels '$1$' foot south, then '$1$' foot west, and then continues to repeat this pattern. In what directions are the bees traveling when they are exactly '$10$' feet away from each other?\n'
=======
CHOICES:
[A]: A\ \text{east, } B\ \text{west}
[B]: A\ \text{north, } B\ \text{south}
[C]: A\ \text{north, } B\ \text{west}
[D]: A\ \text{up, } B\ \text{south}
[E]: A\ \text{up, } B\ \text{west}

PROBLEM: 'Let '$ABCDE$' be an equiangular convex pentagon of perimeter '$1$'. The pairwise intersections of the lines that extend the sides of the pentagon determine a five-pointed star polygon. Let '$s$' be the perimeter of this star. What is the difference between the maximum and the minimum possible values of '$s$'?\n'
=======
CHOICES:
[A]: 0
[B]: \frac{1}{2}
[C]: \frac{\sqrt{5}-1}{2}
[D]:  \frac{\sqrt{5}+1}{2}
[E]: \sqrt{5}

PROBLEM: 'For '$135^\circ < x < 180^\circ$', points '$P=(\cos x, \cos^2 x), Q=(\cot x, \cot^2 x), R=(\sin x, \sin^2 x)$' and '$S =(\tan x, \tan^2 x)$' are the vertices of a trapezoid. What is '$\sin(2x)$'?\n'
=======
CHOICES:
[A]: 2-2\sqrt{2}
[B]: 3\sqrt{3}-6
[C]: 3\sqrt{2}-5
[D]: -\frac{3}{4}
[E]: 1-\sqrt{3}

PROBLEM: 'Let '$ABC$' be a triangle where '$M$' is the midpoint of '$\overline{AC}$', and '$\overline{CN}$' is the angle bisector of '$\angle{ACB}$' with '$N$' on '$\overline{AB}$'. Let '$X$' be the intersection of the median '$\overline{BM}$' and the bisector '$\overline{CN}$'. In addition '$\triangle BXN$' is equilateral with '$AC=2$'. What is '$BX^2$'?\n'
=======
CHOICES:
[A]:  \frac{10-6\sqrt{2}}{7}
[B]: \frac{2}{9}
[C]: \frac{5\sqrt{2}-3\sqrt{3}}{8}
[D]: \frac{\sqrt{2}}{6}
[E]: \frac{3\sqrt{3}-4}{5}
